import React from 'react';


function getDataArray(charList) {
    return Object.entries(charList);
}

const Loader = ({charList}) => {
    const dataArray = getDataArray(charList);
    let JSONdata = JSON.stringify(dataArray.map((el) => el[0]));

    return (
        <div>
            {JSONdata}
        </div>
    );
};

export default Loader;
